import { useState, useEffect } from "react";
import Blogs from "./components/Blogs";

const App = () => {

  const blogs = [
    {
      id: 1,
      name: 'Arto Hellas',
      number: '040-123456'
    },
    {
      id: 2,
      name: 'Ada Lovelace',
      number: '39-44-5323523'
    },
    {
      id: 3,
      name: 'Dan Abramov',
      number: '12-43-234345',
    },
    {
      id: 4,
      name: 'Mary Poppendieck',
      number: '39-23-6423122'
    }
  ]

  return (
    <div className="App">
      <h1>Blogs</h1>
      {blogs}
      <Blogs blogs={blogs} />
    </div>
  );
}

export default App
